// File: client/src/pages/Home.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import api from '../utils/api';

const Home = () => {
  const [featuredGigs, setFeaturedGigs] = useState([]);
  const [categories, setCategories] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const gigsResponse = await api.get('/gigs?sort=top_rated&limit=6');
        setFeaturedGigs(gigsResponse.data);
        
        setCategories([
          { id: 'technical', name: 'Technical Services', icon: 'üíª' },
          { id: 'design', name: 'Design & Creative', icon: 'üé®' },
          { id: 'writing', name: 'Writing & Translation', icon: '‚úçÔ∏è' },
          { id: 'electrical', name: 'Electrical Work', icon: '‚ö°' },
          { id: 'plumbing', name: 'Plumbing Services', icon: 'üöø' },
          { id: 'cleaning', name: 'Cleaning Services', icon: 'üßπ' }
        ]);
      } catch (error) {
        console.error('Error fetching data:', error);
      } finally {
        setIsLoading(false);
      }
    };
    
    fetchData();
  }, []);

  return (
    <div>
      {/* Hero Section */}
      <section className="bg-blue-600 text-white py-16 text-center">
        <h1 className="text-4xl font-extrabold">Find & Offer Services Easily</h1>
        <p className="text-lg mt-4">A Multi-Industry Freelance Service Platform</p>
        <div className="mt-6 flex justify-center space-x-4">
          <Link to="/gigs" className="bg-white text-blue-600 px-6 py-3 rounded-lg font-bold hover:bg-blue-100">Find Services</Link>
          <Link to="/jobs" className="bg-transparent border-2 border-white px-6 py-3 rounded-lg font-bold hover:bg-blue-700">Browse Jobs</Link>
        </div>
      </section>
      
      {/* Categories */}
      <section className="py-12">
        <h2 className="text-2xl font-bold text-center">Browse by Category</h2>
        <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-6 gap-4 mt-6 px-6">
          {categories.map(category => (
            <Link key={category.id} to={`/gigs?category=${category.id}`} className="bg-gray-100 p-6 rounded-lg text-center hover:bg-gray-200">
              <div className="text-3xl">{category.icon}</div>
              <p className="font-semibold mt-2">{category.name}</p>
            </Link>
          ))}
        </div>
      </section>
      
      {/* Featured Gigs */}
      <section className="py-12 bg-gray-50">
        <h2 className="text-2xl font-bold text-center">Top Rated Services</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mt-6 px-6">
          {isLoading ? <p className="text-center">Loading...</p> : featuredGigs.length > 0 ? (
            featuredGigs.map(gig => (
              <div key={gig._id} className="bg-white rounded-lg shadow-md overflow-hidden">
                <div className="h-48 bg-gray-200">
                  {gig.images?.length > 0 ? <img src={gig.images[0]} alt={gig.title} className="w-full h-full object-cover" /> : <div className="h-full flex items-center justify-center text-gray-400">No Image</div>}
                </div>
                <div className="p-4">
                  <h3 className="font-semibold text-lg"><Link to={`/gigs/${gig._id}`} className="hover:text-blue-500">{gig.title}</Link></h3>
                  <p className="text-gray-500">Starting at ${gig.price}</p>
                </div>
              </div>
            ))
          ) : <p className="text-center text-gray-500">No services available.</p>}
        </div>
      </section>
    </div>
  );
};

export default Home;
